import React, {Component, Fragment} from 'react'
import DeskTopLayout from '../../components/layouts/deskTopLayout'

class Promotions extends Component {
  render() {

    return (
      <Fragment>
        <DeskTopLayout>
          <h1>Promotions</h1>
          <div className="about">
            Promotions
          </div>

        </DeskTopLayout>
      </Fragment>

    )
  }
}

export default Promotions
